import  React, {Component} from 'react';
import axios from 'axios';

import employeeTableRow from './employeeTableRow';
import './css/style.css'

export default  class viewEmployee extends  Component{


    constructor(props){
        super(props);

        this.state = {employees : []};

    }

    componentDidMount() {
        axios.get('http://localhost:4000/trainFoodAdmin/admindeliver/')
            .then(response => {
                this.setState({delivers : response.data});

            })
            .catch(function (error){
                console.log(error);
            })
    }

    tabRow(){
        return this.state.delivers.map(function (object, i){
            return <employeeTableRow obj = {object} key = {i}/>;
        });
    }


    render() {
        return(
            <div className='container'>
                <div className='row'>
                    <h2>Current Employees Details</h2>

                </div>
            </div>
        )
    }
}
